/**
 * @param {string} s
 * @return {string}
 */
 var originalDigits = function(s) {
  const arr = [["z","e","r","o"],["o","n","e"],["t","w","o"],["t","h","r","e","e"],["f","o","u","r"],["f","i","v","e"],["s","i","x"],["s","e","v","e","n"],["e","i","g","h","t"],["n","i","n","e"]]
  let numlist = [], sMap = {}, len = s.length
  for(let i=0;i<len;i++){
    sMap[s[i]] = (sMap[s[i]] || 0) + 1
  }
  if(sMap['z']){
    for(let i=0;i<sMap['z'];i++){
      numlist.push(0)
    }
    sMap['e'] -= sMap['z']
    sMap['r'] -= sMap['z']
    sMap['o'] -= sMap['z']
    sMap['z'] = 0
  }
  if(sMap['g']){
    for(let i=0;i<sMap['g'];i++){
      numlist.push(8)
    }
    sMap['e'] -= sMap['g']
    sMap['i'] -= sMap['g']
    sMap['h'] -= sMap['g']
    sMap['t'] -= sMap['g']
    sMap['g'] = 0
  }

  if(sMap['x']){
    for(let i=0;i<sMap['x'];i++){
      numlist.push(6)
    }
    sMap['s'] -= sMap['x']
    sMap['i'] -= sMap['x']
    sMap['x'] = 0
  }

  if(sMap['s']){
    for(let i=0;i<sMap['s'];i++){
      numlist.push(7)
    }
    sMap['e'] -= sMap['s']*2
    sMap['v'] -= sMap['s']
    sMap['n'] -= sMap['s']
    sMap['s'] = 0
  }

  if(sMap['v']){
    for(let i=0;i<sMap['v'];i++){
      numlist.push(5)
    }
    sMap['f'] -= sMap['v']
    sMap['i'] -= sMap['v']
    sMap['e'] -= sMap['v']
    sMap['v'] = 0
  }

  if(sMap['f']){
    for(let i=0;i<sMap['f'];i++){
      numlist.push(4)
    }
    sMap['o'] -= sMap['f']
    sMap['u'] -= sMap['f']
    sMap['r'] -= sMap['f']
    sMap['f'] = 0
  }

  if(sMap['r']){
    for(let i=0;i<sMap['r'];i++){
      numlist.push(3)
    }
    sMap['t'] -= sMap['r']
    sMap['h'] -= sMap['r']
    sMap['e'] -= sMap['r']*2
    sMap['r'] = 0
  }

  if(sMap['w']){
    for(let i=0;i<sMap['w'];i++){
      numlist.push(2)
    }
    sMap['t'] -= sMap['w']
    sMap['o'] -= sMap['w']
    sMap['w'] = 0
  }

  if(sMap['i']){
    for(let i=0;i<sMap['i'];i++){
      numlist.push(9)
    }
    sMap['n'] -= sMap['i']*2
    sMap['e'] -= sMap['i']
    sMap['i'] = 0
  }

  if(sMap['o']){
    for(let i=0;i<sMap['o'];i++){
      numlist.push(1)
    }
  }
  let res = numlist.sort().join('')
  return res
};
